import React from 'react'

const Testimonial = ({ items, isLoading }) => {
  return isLoading ? (
    <h1>Loading...</h1>
  ) : (
    <div>
      {items.map(item => (
        item.name & item.id
      ))}
    </div>
  )
}

export default Testimonial
